CREATE TABLE GENREFILM
(
  NUMFILM    INTEGER,
  CODEGENRE  CHAR(2 BYTE)
)
TABLESPACE USERS
PCTUSED    0
PCTFREE    10
INITRANS   1
MAXTRANS   255
STORAGE    (
            INITIAL          240K
            MINEXTENTS       1
            MAXEXTENTS       2147483645
            PCTINCREASE      0
            BUFFER_POOL      DEFAULT
           )
LOGGING 
NOCACHE
NOPARALLEL
NOMONITORING;


ALTER TABLE GENREFILM ADD (
  PRIMARY KEY
 (NUMFILM, CODEGENRE)
    USING INDEX 
    TABLESPACE USERS
    PCTFREE    10
    INITRANS   2
    MAXTRANS   255
    STORAGE    (
                INITIAL          328K
                MINEXTENTS       1
                MAXEXTENTS       2147483645
                PCTINCREASE      0
               ));


ALTER TABLE GENREFILM ADD (
  FOREIGN KEY (NUMFILM) 
 REFERENCES FILM (NUMFILM));

ALTER TABLE GENREFILM ADD (
  FOREIGN KEY (CODEGENRE) 
 REFERENCES GENRE (CODEGENRE));


GRANT SELECT ON  GENREFILM TO ETU4_ROLE;

GRANT SELECT ON  GENREFILM TO PUBLIC WITH GRANT OPTION;
GRANT REFERENCES ON  GENREFILM TO PUBLIC;
